ontrol wires for a short or a reversed wire.";i:55;s:72:"Also inspect photocell wires at all staple points and connection points.";i:56;s:29:"Replace or correct as needed.";i:57;s:59:"The opener does not close and the main lights are flashing.";i:58;s:40:"Photocells are misaligned or obstructed.";i:59;s:99:"How to Reset a LiftMaster Garage Door Press and release the learn button on the openers motor unit.";i:60;s:135:"During those 30 seconds press down and hold the learn button on the handheld remote control you want to use to operate the garage door.";i:61;s:69:"When the motor units light begins blinking release the remote button.";i:62;s:28:"Malfunctioning Door Control.";i:63;s:165:"Looking at the arrows again if this time the down arrow blinks three times and the up arrow blinks only once it means that there is a problem with your door control.";i:64;s:91:"You should check the door control wires to see if there is a reversed wire or a short wire.";}}